// src/components/CarList.js
import React from 'react';
import CarCard from './CarCard';
import Styles from './CarSeller.module.css';
const CarList = ({ cars }) => {
  return (
    <div className={Styles.car_list}>
      {cars.map((car, index) => (
        <CarCard key={index} car={car} />
      ))}
    </div>
  );
};

export default CarList;
